import React, { Component } from 'react';
import Counter from './counter';

class Tempos extends Component {
    state = {  
        tempos : 
        [
            { id: 1, value: 60},
            { id: 2, value: 120},
            { id: 3, value: 0},
            { id: 4, value: 140},
        ] 
    } 
    render() { 
        return (
        <div>
            { this.state.tempos.map(tempo => <Counter key={tempo} />)}
        </div>);
    }
}

export default Tempos;
